package main

import (
	"fmt"
	"sort"
)

type Node struct {
	IsEnd bool
	Children [26]*Node
}
func (root *Node)addWord(word string) {
	n := root
	for i:=0;i<len(word);i++ {
		char := word[i]
		idx := char-'a'
		if n.Children[idx] == nil {
			n.Children[idx] = new(Node)
		}
		n = n.Children[idx]
	}
	n.IsEnd = true
}


func (root *Node)isConcatenatedWord(word string) bool {
	if word == "" {
		return true
	}
	n:=root
	for i, ch := range word {
		n = n.Children[ch-'a']
		if n == nil {
			return false
		}
		if n.IsEnd && root.isConcatenatedWord(word[i+1:]){
			return true
		}
	}
	return false
}

func findAllConcatenatedWordsInADict(words []string) []string {
	sort.Slice(words, func(i, j int) bool { return len(words[i]) < len(words[j]) })

	root := new(Node)
	var result []string
	for _, word := range words {
		if word == "" {
			continue
		}
		if root.isConcatenatedWord(word) {
			result = append(result, word)
		} else {
			root.addWord(word)
		}
	}
	return result
}

